  E[1][0] = sin(q6)*(sin(q1)*sin(q5)+cos(q2+q3+q4)*cos(q1)*cos(q5))+sin(q2+q3+q4)*cos(q1)*cos(q6);
  E[1][1] = -sin(q6)*(cos(q1)*sin(q5)-cos(q2+q3+q4)*cos(q5)*sin(q1))+sin(q2+q3+q4)*cos(q6)*sin(q1);
  E[1][2] = cos(q2+q3+q4)*cos(q6)-sin(q2+q3+q4)*cos(q5)*sin(q6);
  E[1][3] = (sin(q6)*(sin(q1)*sin(q5)+cos(q2+q3+q4)*cos(q1)*cos(q5))+sin(q2+q3+q4)*cos(q1)*cos(q6))*(sin(q1)*(1.33E+2/1.0E+3)-cos(q1)*cos(q2)*(1.7E+1/4.0E+1)+cos(q5)*sin(q1)*(1.1E+1/4.0E+1)-cos(q2+q3+q4)*cos(q1)*sin(q5)*(1.1E+1/4.0E+1)+(cos(q2+q3)*cos(q1)*sin(q4))/1.0E+1+(sin(q2+q3)*cos(q1)*cos(q4))/1.0E+1-cos(q1)*cos(q2)*cos(q3)*(4.9E+1/1.25E+2)+cos(q1)*sin(q2)*sin(q3)*(4.9E+1/1.25E+2))+(cos(q2+q3+q4)*cos(q6)-sin(q2+q3+q4)*cos(q5)*sin(q6))*(sin(q2+q3)*(4.9E+1/1.25E+2)+sin(q2)*(1.7E+1/4.0E+1)+sin(q5)*(cos(q2+q3)*sin(q4)*(1.1E+1/4.0E+1)+sin(q2+q3)*cos(q4)*(1.1E+1/4.0E+1))+(cos(q2+q3)*cos(q4))/1.0E+1-(sin(q2+q3)*sin(q4))/1.0E+1-1.63E+2/1.0E+3)+(sin(q6)*(cos(q1)*sin(q5)-cos(q2+q3+q4)*cos(q5)*sin(q1))-sin(q2+q3+q4)*cos(q6)*sin(q1))*(cos(q1)*(1.33E+2/1.0E+3)+cos(q1)*cos(q5)*(1.1E+1/4.0E+1)+cos(q2)*sin(q1)*(1.7E+1/4.0E+1)-sin(q1)*sin(q2)*sin(q3)*(4.9E+1/1.25E+2)+cos(q2+q3+q4)*sin(q1)*sin(q5)*(1.1E+1/4.0E+1)-(cos(q2+q3)*sin(q1)*sin(q4))/1.0E+1-(sin(q2+q3)*cos(q4)*sin(q1))/1.0E+1+cos(q2)*cos(q3)*sin(q1)*(4.9E+1/1.25E+2));
  E[2][0] = -cos(q5)*sin(q1)+cos(q2+q3+q4)*cos(q1)*sin(q5);
